    }
    return res.status(200).send({"status":200 , "message": " Get car ad by id ", "data" :reflection});
  },

  getA1(req, res) {

    const reflection = ReflectionModel.findA1(req.query.success , req.query.lowPoint);
    if (!reflection) {
